import React, { Fragment } from 'react';

const Review = (props) => {
    console.log(props.scores.nightlife);
    return (
        <Fragment>
            <button>
                <h1>Your current review:</h1>
                <div className="column">
                    <h3>{props.scores.nightlife}</h3>
                </div>
            </button>
        </Fragment>
    )

}

export default Review;
